import React from 'react';
import {Column, setURL} from '@instinct-web/core';
import {Row} from '../../components/generic/row/Row';
import {UserLayout} from '../../components/layout/user';
import {Card} from '../../components/generic/card/Card';
import {Jumbotron} from '../../components/generic/jumbotron/Jumbotron';
import {Container} from '../../components/generic/container/Container';

setURL('gangs/:gangID/edit', <GangEdit />);

export function GangEdit() {
  return (
    <UserLayout section="community_team">
      <Jumbotron title="Gang Editor">
        <p>Gang</p>
      </Jumbotron>
      <Container>
        <Row>
          <Column side="left">
            <Card>
              <p>Coming soon</p>
            </Card>
          </Column>
        </Row>
      </Container>
    </UserLayout>
  );
}
